function HomePage() {
  return (
    <div className="container d-flex justify-content-center">
      <img
        src="https://i.imgur.com/XXjFbye.jpeg"
        alt="stupify"
        height="50%"
        width="50%"
      ></img>
      <p>Can we stop and get some Spotify?</p>
    </div>
  );
}

export default HomePage;
